import * as React from 'react';
import Pagination from '@mui/material/Pagination';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Title from './Title';
import TextFields from '../components/Textfield';
import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';



const page={
  padding:'10px'
}

// Generate Order Data
function createData(id, date, name, category, description, amount) {
  return { id, date, name, category, description, amount };
}

const rows = [
  createData(
    0,
    '8/16/2022',
    'Diapers',
    'BABY_DIAPER',
    'Size 1'
  ),
  createData(
    1,
    '7/20/2022',
    'Radio',
    'ELECTRONICS',
    'Set of 3'
  ),

  createData(
    3,
    '1/19/2022',
    'Hoodie',
    'ADULT_CLOTHING',
    'Size XL'
  ),
  createData(
    4,
    '6/01/2022',
    'Chapstick',
    'ADULT',
    '12 Packs of 2'
  ),
  createData(
    5,
    '9/10/2022',
    'Soap',
    'HYGIENE',
    'Dove Sensitive Skin'
  )
];

// function preventDefault(event) {
//   event.preventDefault();
// }

export default function Orders() {
  return (
    <React.Fragment>
       <Box
       backgroundColor="#1976D2"

      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >

<>
      <h2 style={{
        color: "white",
        //textAlign:'center',
        marginLeft:'-3.5rem'
        // font-family: "Roboto"
      }} >
        Current Inventory</h2>
      </>
      <TextField id="outlined-basic" label="Enter Product Name..." variant="outlined" sx/>
      </Box>
      {/* <Title>Current Inventory</Title> */}
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>Date</TableCell>
            <TableCell>Name</TableCell>
            <TableCell><TextFields/></TableCell>
            <TableCell>Description</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.date}</TableCell>
              <TableCell>{row.name}</TableCell>
              <TableCell>{row.category}</TableCell>
              <TableCell>{row.description}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <Pagination count={4} variant="outlined" style={page}/>
    </React.Fragment>
  );
}



